import React from "react";
import '../css/Contact.css'
class Contact extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      images: [
        "assets/images/hostel7.jpg",
        "https://picsum.photos/200/300/?image=524"
      ],
      selectedImage: "https://picsum.photos/200/300/?image=523"
    };
  }

  componentDidMount() {
    setInterval(() => {
      this.setState(prevState => {
        if (prevState.selectedImage === this.state.images[0]) {
          return {
            selectedImage: this.state.images[1]
          };
        } else {
          return {
            selectedImage: this.state.images[0]
          };
        }
      });
    }, 3000);
  }

  render() {
    return (
      <div >
        {/*<img src={this.state.selectedImage} alt="" width="100%" height="500px" style={{marginLeft:"auto"}}/>*/}

        <div className="container-fluid p-0 main_carousel_container">
          <div id="carouselExampleSlidesOnly" class="carousel slide carousel-fade" data-ride="carousel">
            <div class="carousel-inner">
              <div class="carousel-item active">
                  <img src="https://d19m59y37dris4.cloudfront.net/directory/1-6/img/photo/photo-1501621965065-c6e1cf6b53e2.jpg" class="d-block w-100" alt="test"/>
              </div>
              <div class="carousel-item">
                <img src="https://d19m59y37dris4.cloudfront.net/directory/1-6/img/photo/photo-1519974719765-e6559eac2575.jpg" class="d-block w-100" alt="test"/>
              </div>
              <div class="carousel-item">
                <img src="https://d19m59y37dris4.cloudfront.net/directory/1-6/img/photo/photo-1490578474895-699cd4e2cf59.jpg" class="d-block w-100" alt="test"/>
              </div>
            </div>
          </div>  
        </div>

        <div className="container main_search_container">
          <div className="searchbar_main">
            <form>
              <div className="row">
                <div className="col-lg-4">
                  <div className="main_search_div">
                    <p type="search" className="form-control" placeholder="Where are You Searching For ?" readOnly="readOnly" ></p>
                  </div>
                </div>
                <div className="col-lg-3">
                  <div className="main_search_div">
                    <input type="search" className="form-control" placeholder="Location" ></input>
                  </div>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    );
  }
}

export default Contact;
